// Navbar.js
import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FaBars, FaTimes, FaCog } from 'react-icons/fa';
import Swal from 'sweetalert2';
import 'index.css'; // Tailwind not enough for custom SweetAlert and blur effect

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);
  const [darkMode, setDarkMode] = useState(() => localStorage.getItem('theme') === 'dark');

  const navigate = useNavigate();

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth < 768);
    };
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  useEffect(() => {
    document.documentElement.classList.toggle('dark', darkMode);
    localStorage.setItem('theme', darkMode ? 'dark' : 'light');
  }, [darkMode]);

  const handleLogout = () => {
    Swal.fire({
      title: 'Are you sure?',
      text: "You will be logged out.",
      icon: 'warning',
      showCancelButton: true,
      confirmButtonColor: '#3085d6',
      cancelButtonColor: '#d33',
      confirmButtonText: 'Yes, logout!',
      cancelButtonText: 'No, cancel',
      customClass: {
        confirmButton: 'custom-swal-btn',
        cancelButton: 'custom-swal-btn',
      },
    }).then((result) => {
      if (result.isConfirmed) {
        localStorage.removeItem('token');
        navigate('/');
      }
    });
  };

  const NavLinks = () => (
    <>
      <Link to="/" className="hover:underline text-lg font-medium">Home</Link>
      <Link to="/upload" className="hover:underline text-lg font-medium">Analyze</Link>
      <button
        onClick={handleLogout}
        className="bg-red-500 hover:bg-red-600 text-white font-semibold px-4 py-2 rounded-full shadow-lg transition-all"
      >
        Logout
      </button>
    </>
  );

  const AuthButtons = () => (
    <>
      <Link to="/signup">
        <button className="bg-gradient-to-r from-indigo-400 to-purple-500 text-white px-6 py-2 rounded-full shadow-md hover:scale-105 transition-all">
          Sign Up
        </button>
      </Link>
      <Link to="/login">
        <button className="bg-gradient-to-r from-pink-400 to-red-400 text-white px-6 py-2 rounded-full shadow-md hover:scale-105 transition-all">
          Login
        </button>
      </Link>
    </>
  );

  return (
    <nav className="fixed top-0 left-0 right-0 z-50 bg-white/90 dark:bg-gray-900/90 backdrop-blur-md shadow-md">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">

          {/* Logo */}
          <div className="flex-shrink-0 text-2xl font-bold text-indigo-600 dark:text-indigo-300">
            DocuMind AI
          </div>

          {/* Desktop Nav */}
          {!isMobile && (
            <div className="flex gap-6 items-center">
              <div className="flex gap-6">
                <NavLinks />
              </div>
              <div className="flex gap-4">
                <AuthButtons />
                <div className="relative group">
                  <FaCog className="text-2xl cursor-pointer text-gray-700 dark:text-gray-300" />
                  <div className="absolute top-10 right-0 bg-white dark:bg-gray-800 border dark:border-gray-600 rounded-lg p-3 hidden group-hover:block shadow-lg w-40">
                    <label className="flex items-center gap-2">
                      <input
                        type="checkbox"
                        checked={darkMode}
                        onChange={() => setDarkMode(!darkMode)}
                        className="form-checkbox h-5 w-5 text-indigo-600"
                      />
                      <span className="text-sm">Dark Mode</span>
                    </label>
                  </div>
                </div>
              </div>
            </div>
          )}

          {/* Mobile Hamburger */}
          {isMobile && (
            <button
              onClick={() => setIsOpen(!isOpen)}
              className="text-2xl text-gray-700 dark:text-white z-50"
            >
              {isOpen ? <FaTimes /> : <FaBars />}
            </button>
          )}
        </div>
      </div>

      {/* Mobile Sidebar */}
      {isMobile && isOpen && (
        <div className="fixed inset-0 bg-black/40 backdrop-blur-sm z-40">
          <div className="fixed top-0 right-0 w-64 h-full bg-white dark:bg-gray-900 shadow-lg p-6 flex flex-col gap-6">
            <NavLinks />
            <AuthButtons />
            <div className="mt-4">
              <label className="flex items-center gap-2">
                <input
                  type="checkbox"
                  checked={darkMode}
                  onChange={() => setDarkMode(!darkMode)}
                  className="form-checkbox h-5 w-5 text-indigo-600"
                />
                <span className="text-sm">Dark Mode</span>
              </label>
            </div>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
